import React from "react";
import s from './My posts.module.css';

const MyPosts = () => {
    return (
        <div>
            My post
            <div>
                new post
            </div>
            <div className={s.posts}>
                <div className={s.item}>
                    post 1
                </div>
                <div className={s.item}>
                    post 2
                </div>
            </div>
        </div> )
}

export default MyPosts;
